import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  BrowserRouter
} from "react-router-dom";

function App() {
  return (

<div>
   <MyNav />
   <BrowserRouter>
   <Switch>
     <Route exact path="/">


   <MyCarousel />
   <WhatsNew />
   <Newsletter />
     </Route>
     <Route path="/Electronics">
<Electronics />
     </Route>
   </Switch>
   </BrowserRouter>
   <Footer />
</div>
  );
}

export default App;
